      "properties": {},
      "geometry": {
        "type": "Polygon",
        "coordinates": [
          [
            [
              106.694123,
              10.73023
            ],
            [
              106.694064,
              10.729961
            ],
            [
              106.694638,
              10.729861
            ],
            [
              106.69475,
              10.730135
            ],
            [
              106.694123,
              10.73023
            ]
          ]
        ]
      }
    }
  ]
}


export default drawnGeoJSON;
